Prepare to save Aliens and (Yes!) Humanity with Peti, THE Puzzle Game !
Match 4+ elements of the same color to make them disappear, and if an alien is included, it'll be saved. Clear the level from its aliens to win.

LevelUp Studio is proud to present PETI! In this gorgeous puzzle game, Aliens falls on Earth and you have to send them back to their mother. Doing so, she may not get mad and destroy our beautiful Earth. Save 'em Up and you'll be a hero for aliens and mankind (Yes again!) alike.

Earn experience and buy special powers to help those little invaders get out from our planet. Special powers can allow you to change the color of blocks, destroy blocks or raise your chance to get special blocks.

Required Android O/S : 2.0.1+


